import {connect} from 'react-redux';
import Auth0CallbackHandler from "../../components/auth/Auth0CallbackHandler";
import {SET_AUTH_0_RESPONSE} from "../../reducers/UserAuthReducer";

const mapStateToProps = (state) => ({
    handleAuthentication: state.userAuth.handleAuthentication
});

const mapDispatchToProps = (dispatch) => ({
    setAuth0Response: (response) => dispatch({type: SET_AUTH_0_RESPONSE, response})
});

export default connect(mapStateToProps, mapDispatchToProps)(Auth0CallbackHandler);
